(function () {
    function Tilt(element, options) {
        this.element = element;
        this.settings = Object.assign({
            maxTilt: 20,
            perspective: 300,
            easing: 'cubic-bezier(.03,.98,.52,.99)',
            scale: 1,
            speed: 400,
            reset: true,
            glare: false,
            maxGlare: 1
        }, options);
        this.init();
    }

    Tilt.prototype.init = function () {
        this.bindEvents();
        if (this.settings.glare) {
            this.prepareGlare();
        }
    };

    Tilt.prototype.bindEvents = function () {
        this.element.addEventListener('mousemove', this.handleMouseMove.bind(this));
        this.element.addEventListener('mouseenter', this.handleMouseEnter.bind(this));
        if (this.settings.reset) {
            this.element.addEventListener('mouseleave', this.handleMouseLeave.bind(this));
        }
    };

    Tilt.prototype.handleMouseEnter = function () {
        this.element.style.transition = `${this.settings.speed}ms ${this.settings.easing}`;
    };

    Tilt.prototype.handleMouseMove = function (event) {
        const rect = this.element.getBoundingClientRect();
        const x = (event.clientX - rect.left) / rect.width;
        const y = (event.clientY - rect.top) / rect.height;

        const tiltX = (this.settings.maxTilt / 2 - x * this.settings.maxTilt).toFixed(2);
        const tiltY = (y * this.settings.maxTilt - this.settings.maxTilt / 2).toFixed(2);

        this.element.style.transform = `perspective(${this.settings.perspective}px) rotateX(${tiltY}deg) rotateY(${tiltX}deg) scale(${this.settings.scale})`;

        if (this.settings.glare) {
            this.updateGlare(x, y);
        }
    };

    Tilt.prototype.handleMouseLeave = function () {
        this.element.style.transition = `${this.settings.speed}ms ${this.settings.easing}`;
        this.element.style.transform = `perspective(${this.settings.perspective}px) rotateX(0deg) rotateY(0deg) scale(${this.settings.scale})`;
        if (this.settings.glare) {
            this.glare.style.opacity = '0';
        }
    };

    Tilt.prototype.prepareGlare = function () {
        this.glare = document.createElement('div');
        this.glare.classList.add('tilt-glare');
        Object.assign(this.glare.style, {
            position: 'absolute',
            top: '50%',
            left: '50%',
            width: `${this.element.offsetWidth * 2}px`,
            height: `${this.element.offsetHeight * 2}px`,
            transform: 'translate(-50%, -50%) rotate(180deg)',
            background: 'linear-gradient(0deg, rgba(255,255,255,0) 0%, rgba(255,255,255,1) 100%)',
            opacity: '0',
            pointerEvents: 'none'
        });
        this.element.style.position = 'relative';
        this.element.appendChild(this.glare);
    };

    Tilt.prototype.updateGlare = function (x, y) {
        const glareAngle = Math.atan2(x - 0.5, 0.5 - y) * (180 / Math.PI);
        const glareOpacity = Math.min(Math.max(y, 0), 1) * this.settings.maxGlare;
        Object.assign(this.glare.style, {
            transform: `translate(-50%, -50%) rotate(${glareAngle}deg)`,
            opacity: glareOpacity.toString()
        });
    };

    // Attach to all elements with the data-tilt attribute
    document.querySelectorAll('[data-tilt]').forEach(element => {
        new Tilt(element, JSON.parse(element.getAttribute('data-tilt-options') || '{}'));
    });
})();
